    geo_json_fe45bb8ade2bc2f46db4b3f7cf597d47.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["sgs_id", "zone", "exclusion_reasons"];
    let aliases = ["Property id", "Zone", "Reasons for exclusion"];
    let table = '<table>' +
        String(

        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
